import { Link } from "react-router-dom"
const DUMMY_EVENTS = [{
    id: 'e1',
    title: 'Java'
},
{
    id: 'e2',
    title: 'JavaScript'
},
{
    id: 'e3',
    title: 'Pyhton'
}]
export default function EventsPage(){
    return <>
    <ul>
        {DUMMY_EVENTS.map(e =>{
            return <li key={e.id}>
                <Link to={e.id}>{e.title}</Link>
            </li>
        })}</ul></>
}
